INSERT INTO `mdl_course` (`id`, `category`, `sortorder`, `fullname`, `shortname`, `idnumber`, `summary`, `summaryformat`, `format`, `showgrades`, `newsitems`, `startdate`, `enddate`, `relativedatesmode`, `marker`, `maxbytes`, `legacyfiles`, `showreports`, `visible`, `visibleold`, `downloadcontent`, `groupmode`, `groupmodeforce`, `defaultgroupingid`, `lang`, `calendartype`, `theme`, `timecreated`, `timemodified`, `requested`, `enablecompletion`, `completionnotify`, `cacherev`, `originalcourseid`, `showactivitydates`, `showcompletionconditions`, `pdfexportfont`) VALUES
(1, 0, 1, 'MPPLab Knowledge Dissemination Platform', 'MPPLab Knowledge Dissemination Platform', '', '<p>Courses provided by C-DAC for MPPLab E-Learning </p>', 0, 'site', 1, 5, 0, 0, 0, 0, 0, 0, 0, 1, 1, NULL, 0, 0, 0, '', '', '', 1727244230, 1729699748, 0, 0, 0, 1736328901, NULL, 0, NULL, NULL),
(6, 6, 40001, 'Artificial Intelligence(AI)-Machine Learning(ML)', 'AI', '', '<p dir=\"ltr\" style=\"line-height: 1.38; text-align: justify; margin-top: 12pt; margin-bottom: 12pt;\" id=\"docs-internal-guid-f486c496-7fff-3ecd-9dec-5ff7050318b5\"><span style=\"font-size: 12pt; font-family: Calibri,sans-serif; color: #000000; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">The course on Traffic Matrix Prediction and Optimization offers a comprehensive understanding of how to effectively manage telecom networks through advanced predictive models and optimization techniques. It begins by establishing the importance of accurately predicting traffic patterns to ensure efficient network performance. From there, it delves into the process of data collection and preprocessing, which forms the foundation for developing accurate models.</span></p>\r\n<p dir=\"ltr\" style=\"line-height: 1.38; text-align: justify; margin-top: 12pt; margin-bottom: 12pt;\"><span style=\"font-size: 12pt; font-family: Calibri,sans-serif; color: #000000; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">The course explores various prediction models, from statistical-methods to more advanced machine learning and deep-learning techniques, allowing for a comparison of their strengths and limitations. It also emphasizes the importance of feature engineering and dimensionality reduction to improve model efficiency.</span></p>\r\n<p dir=\"ltr\" style=\"line-height: 1.38; text-align: justify; margin-top: 12pt; margin-bottom: 12pt;\"><span style=\"font-size: 12pt; font-family: Calibri,sans-serif; color: #000000; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">A critical aspect of the course is the focus on model training and evaluation, where learners gain insights into performance metrics and techniques for model refinement. Following this, traffic optimization methods are introduced, covering routing, resource-allocation, and Quality of Service (QoS) improvements.</span></p>', 1, 'topics', 1, 5, 1732213800, 1732473000, 0, 0, 0, 0, 0, 1, 1, NULL, 2, 0, 0, '', '', '', 1729148787, 1736242181, 0, 1, 0, 1736328901, NULL, 1, 1, NULL),
(7, 4, 30003, 'Software Defined Networks - Beginners', 'SDN-I', '', '<h6 id=\"docs-internal-guid-4b621cc2-7fff-348a-7992-cdd211ef98a1\" dir=\"ltr\" style=\"line-height: 1.38; text-align: justify; margin-top: 10pt; margin-bottom: 0pt;\"><span style=\"font-size: 12pt; font-family: Calibri,sans-serif; color: #000000; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">This course explores how SDN decouples network control from the underlying hardware, enabling dynamic, programmable, and centrally managed networks.</span></h6>\r\n<h6 dir=\"ltr\" style=\"line-height: 1.38; text-align: justify; margin-top: 10pt; margin-bottom: 0pt;\"><span style=\"font-size: 12pt; font-family: Calibri,sans-serif; color: #000000; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">Participants will gain hands-on experience with Mininet, an open-source SDN network emulator, and will explore key SDN controllers such as ONOS and OpenDaylight (ODL). The course also delves into OpenFlow, the leading protocol in SDN, covering its role in communication between controllers and network devices.</span></h6>\r\n<h6 dir=\"ltr\" style=\"line-height: 1.38; text-align: justify; margin-top: 10pt; margin-bottom: 0pt;\"><span style=\"font-size: 12pt; font-family: Calibri,sans-serif; color: #000000; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">In the practical section, learner will engage in exploration activities such as VOIP and UDP testing, configuring an L2 learning switch, and a simple Firewall in SDN mininet topology.</span></h6>\r\n<h6 dir=\"ltr\" style=\"line-height: 1.38; text-align: justify; margin-top: 10pt; margin-bottom: 0pt;\"><span style=\"font-size: 12pt; font-family: Calibri,sans-serif; color: #000000; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">The course also covers advanced topics such as Subnetting in SDN-based networks and Forwarding based on TCP port, giving participants real-world scenarios and hands-on skills for SDN applications.</span></h6>', 1, 'topics', 1, 5, 1732213800, 1764009000, 0, 0, 0, 0, 0, 1, 1, NULL, 1, 1, 0, '', '', '', 1729533239, 1732185130, 0, 1, 0, 1736328901, NULL, 1, 1, NULL),
(9, 4, 30002, 'Math Modelling', 'Math Modelling', '', '<p dir=\"ltr\" style=\"line-height: 1.38; text-align: justify; margin-top: 0pt; margin-bottom: 0pt;\" id=\"docs-internal-guid-d9a204e0-7fff-d0ff-428a-795ff43c0cf2\"><span style=\"font-size: 12pt; font-family: Calibri,sans-serif; color: #000000; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">A telecom mathematical model is a framework that uses mathematical equations, statistical methods, and algorithmic techniques to simulate and predict telecommunications interactions between different geographic locations or demographic groups. It typically incorporates variables such as population size, geographic distance, time zones, languages, and socioeconomic factors to estimate telecom behaviors, including call frequency, data traffic, and network load.</span></p>', 1, 'topics', 1, 5, 1732213800, 1764009000, 0, 0, 0, 0, 0, 1, 1, NULL, 0, 0, 0, '', '', '', 1729620118, 1736242433, 0, 1, 0, 1736328901, NULL, 1, 1, NULL),
(10, 4, 30001, 'NS3-OMNET', 'NS3-OMNET', '', '<p dir=\"ltr\" style=\"line-height: 1.38; text-align: justify; margin-top: 12pt; margin-bottom: 12pt;\" id=\"docs-internal-guid-ac522fba-7fff-0e03-c9fd-fac8754bbd6d\"><span style=\"font-size: 12pt; font-family: Calibri,sans-serif; color: #000000; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">Wireless broadband technologies are pivotal in addressing the growing demand for faster and more reliable communication systems. The evolution of cellular networks into the next generation, such as 5G, requires significant collaboration among a wide range of stakeholders, including standards organizations like the 3GPP and ITU, telecommunications operators, equipment manufacturers, and service providers. The process of developing innovative solutions for these networks requires a substantial amount of time and resources, making it both costly and complex. In this context, simulation has become an essential tool. By creating models and simulations of real-world network scenarios, researchers and engineers can analyze network behaviors under various conditions without the risks and costs associated with real-life trials. The use of network simulators, such as ns-3 and OMNeT++, enables the generation of traffic datasets and the testing of various network configurations, helping to evaluate critical performance metrics like handover processes, signal strength, Quality of Service (QoS), and the efficiency of network slicing. Given the challenges involved in accessing real-world datasets, particularly due to issues of confidentiality and competitive concerns among network carriers, simulators provide a valuable alternative for modeling and testing new solutions.</span></p>\r\n<p dir=\"ltr\" style=\"line-height: 1.38; text-align: justify; margin-top: 12pt; margin-bottom: 12pt;\"><span style=\"font-size: 12pt; font-family: Calibri,sans-serif; color: #000000; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">This presentation delves into multiple simulation exercises that explore key aspects of 5G network design. The first exercise examines the handover process, where two mobile user devices move through coverage areas of four strategically placed gNodeBs. The scenario simulates the handover process by evaluating signal strength, triggering handover requests when the signal from the current gNodeB falls below a threshold, and ensuring a seamless transition to the next gNodeB. The handover mechanism includes signal strength evaluation, handover requests, authentication, execution, and post-handover synchronization, ensuring continuous and uninterrupted connectivity for mobile users. The second exercise simulates mobility in an urban environment using a Manhattan grid model. This model mimics the movement of vehicles through a city, exploring how the layout of streets and the frequent changes in direction impact handover frequency, signal quality, and network performance. By simulating the movement of a remote-controlled car within the grid using the SUMO tool, the study compares handover performance in different directions (horizontal vs. vertical) and assesses the impact of speed variations on network stability and handover delays. The third exercise focuses on network slicing, using OMNeT++ to simulate the performance of different network slices: enhanced Mobile Broadband (eMBB), ultra-Reliable Low Latency Communications (uRLLC), massive Machine-Type Communications (mMTC), and a general-purpose slice. This exercise evaluates the trade-offs between delay and throughput for each slice type, showing how network slicing enables the allocation of resources according to specific application needs, such as low latency for critical services or high throughput for data-heavy applications. Each slice’s performance is assessed based on key metrics, including delay, throughput, and scalability, with particular attention given to how each slice meets the distinct needs of its target applications. Overall, these exercises provide valuable insights into the dynamic nature of next-generation networks and demonstrate the essential role of simulation in their design and optimization.</span></p>', 1, 'topics', 1, 5, 1732213800, 1732525920, 0, 0, 0, 0, 0, 1, 1, NULL, 0, 0, 0, '', '', '', 1729783975, 1736242571, 0, 1, 0, 1736328901, NULL, 1, 1, NULL);
