(1, 1, 1, 'About us', '<p> <img src=\"@@PLUGINFILE@@/image%20%282%29.png\" width=\"748\" height=\"228\"></p>\r\n<p>MPPLab Knowledge Dissemination Platform is a training and skill development platform for nurturing young &amp; outstanding scientists who would like to take up their career in HPC Sciences. This is the system to be used for training manpower to understand concepts underlying the new Highly Specialized Machine (HSM) and use it effectively. This platform will engage talented young workforce by imparting very advanced training by means of the \"e-Teacher\".</p>\r\n<p></p>', 1, '65', 1, '{\"op\":\"&\",\"c\":[],\"showc\":[]}', NULL, NULL, 1729699466),
